import './App.css';
import Map from "mapmyindia-react";
import React from 'react';
var lat= 18.5314,long=73.845;
/*axios.get(`http://localhost:3000/update`)
 .then(res => {
 const countries = res.;
 this.setState({ countries });
})*/


function App() {
  fetch('http://localhost:3000/update').then(function() {
  const url = window.location.search;
  lat=parseFloat(url.substr(url.indexOf('=')+1));
  long=parseFloat(url.substr(url.indexOf('g')+2));
  console.log('lat =' +lat +' long = '+long);
  });
	fetch('http://localhost:3000/show').then(function() {	 
    return (
		 	 <Map
          markers={[
              { 
                  position: [ parseFloat(lat) , parseFloat(long)],
                  draggable: true, 
                  title:"Marker title",
                  onClick: e => {
                      console.log("clicked ");
                  },
                  onDragend: e => {
                      console.log("dragged");
                  }
              }
          ]}
          />

		 )
	 });
  }
export default App;
